import 'Register.css'

class Register extends Component
{
    render(){
        return (
                 <section className="bg-primary text-white mb-0 RegisterHeader">
                 <div className="container">
                    <h2 className="text-center text-uppercase text-white">Register</h2>
                    <hr  />
                    </div>
                 </section>
        );
    }
}

export default Register;
